(function(){'use strict';angular.module('app.company').factory('CompanyFactory',CompanyFactory).controller('CompanyListController',companyListController);companyListController.$inject=['company','organization','deleteCompanyModal'];function companyListController(company,organization,deleteCompanyModal){var vm=this;vm.organization=organization[0];vm.company=company[0];vm.delete=deleteCompanyModal.getDeleteMethod(vm.company);}CompanyFactory.$inject=['$http','AuthTokenFactory'];function CompanyFactory($http,AuthTokenFactory){'use strict';var vm=this;vm.getCompany=getCompany;return{getCompany:getCompany};function getCompany(){if(AuthTokenFactory.getToken()){return $http.get('/api/v1/company/').then(function success(response){return response;});}else{console.log('no auth token');}}};})();